import React from 'react';

import './experiences.css';


import MemoryGame from '../../memoryGame/index';


export default function Experiences(props) {

  return (
    <section id={"project-"+props.active+props.class} className={props.active===2?'project-section active ':'project-section'} >

<MemoryGame {...props}/>
   </section>
  );
}
